import React from "react";
import PropTypes from "prop-types";

import "antd/dist/antd.css";
import Head from "next/head";

const App = ({ Component }) => {
  return;
  <>
    <Head></Head>
    <Component />
  </>;
};

App.propTypes = {
  Compoenet: PropTypes.element.isRequired,
};

export default App;
